import React from "react";

import Loading from "../Loading";
import Post from "./Post";

const FreeBoardLists = ({ posts, loading }) => {
  //console.log(posts);

  return (
    <>
      {loading && <Loading />}
      <div className="max-w-480 min-h-screen">
        <div className="flex items-center px-5 items-stretchh-12 border-b border-gray-light">
          <h1 className="text-xl font-bold">자유게시판</h1>
        </div>
        {posts.map((post) => (
          <Post key={post.id} post={post} />
        ))}
      </div>
    </>
  );
};

export default FreeBoardLists;
